"use client"
import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';

import { fetchWeatherInfo, setSearch } from '../Features/weatherSlice';
function Header() {
const dispatch=useDispatch();
  const search = useSelector((state) => state.weather.search);
  const weatherStatus = useSelector((state) => state.weather.weatherStatus);
  useEffect(()=>{
    if(weatherStatus!=="pending")
    { 
      dispatch(fetchWeatherInfo(search));
    }
    
    },[dispatch, weatherStatus]);




  return (
        <>
          <div className=' w-full fixed top-0 xl:h-20  h-40  z-10     xl:gap-20 gap-5 flex xl:flex-row flex-col overflow-hidden   shadow-xl   px-10'>
          <div className='flex flex-col justify-center'>
          <div className='flex '>
          <div className="h-16 overflow-hidden bg-transparent rounded-full  ">
              <img className='w-full h-full object-cover  '  src="
              data:image/png;base64,

              " alt="" />
          </div>
          <h1 className=' text-nowrap pt-[1.1rem] px-2 font-[ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji] text-3xl text-gray-500    font-bold'>Weather Forecast</h1>
          
          </div>
          
          </div>
          <div className=' flex xl:flex-col justify-center'>
          <div className='flex h-12 bg-[#f2f2f2] w-[35rem] p-1 rounded-full overflow-hidden pl-5'>
            <input className='bg-[#f2f2f2] h-full w-[29.8rem] focus:border-none outline-none '  value={search} placeholder="search..."  onChange={(e)=>{dispatch(setSearch(e.target.value))}} />
            <div className='h-full w-[1px] bg-gray-300'></div>
            <button className='bg-[#f2f2f2] h-full w-[3rem] px-4'>
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20.004"><path d="m19.705 18.288-5.531-5.531a7.927 7.927 0 1 0-1.424 1.421l5.531 5.532a1.006 1.006 0 0 0 1.422-1.422ZM3.738 12.096a5.908 5.908 0 1 1 8.354 0 5.869 5.869 0 0 1-8.354 0Z"></path></svg>
            </button>
          </div>
          </div>
          
          </div>
        </>
          
        
    );
}

export default Header;